import React from "react";

const ImageSearch = (props) => {
  console.log(props);
  return (
    <div>
      <form>
        <input
          type="text"
          autoComplete="off"
          name="searchvalue"
          placeholder="Search"
        />
        <button>Search</button>
      </form>
    </div>
  );
};

export default ImageSearch;
